def reentry_heatfluxes(interpolated_heatfluxes, thickness, density, surface_area, internal_heating):
    specific_temps = np.array([-17.6, 121.3, 260.2, 399.1, 538.0,676.9, 815.7, 926.9])
    specific_temps =specific_temps + 273.15
    specific_alphas = np.array([0.405,0.540,0.648,0.72,0.792,0.576,0.48,0.432])
    specific_heats = np.array([628,879,1055,1151,1205,1239,1256,1264])

    emissivity_temps = np.array([27,127,227,327,427,527,627,727,827,927,1027,1127,1227,1327])
    emissivity_temps = emissivity_temps + 273.15
    emissivity_vals = np.array([0.88,0.836,0.766,0.684,0.604,0.532,0.469,0.418,0.374,0.339,0.309,0.285,0.265,0.248])


    outer_skin_temp = 150 #K
    outer_weight = thickness * 1 * density / 2
    inner_weight = thickness * 1 * density / 2
    inner_skin_temp = 150 #K

    stepcount = len(interpolated_heatfluxes)+1000
    timelist = np.zeros(stepcount)
    outer_skin_templist = np.zeros(stepcount)
    inner_skin_templist = np.zeros(stepcount)
    internal_heatdump = np.zeros(stepcount)

    for i in range(stepcount):
        outer_specific_heat = np.interp(outer_skin_temp, specific_temps
                                        , specific_heats)
        inner_specific_heat = np.interp(inner_skin_temp, specific_temps
                                        , specific_heats)
        average_specific_heat = (outer_specific_heat+inner_specific_heat)/2
        conductivity = np.interp((outer_skin_temp+inner_skin_temp)/2,specific_temps,specific_alphas)*10**-6*194*average_specific_heat
        outer_emissivity = np.interp(outer_skin_temp,emissivity_temps,emissivity_vals)

        if i < len(interpolated_heatfluxes):
            outer_skin_heatflux = interpolated_heatfluxes[i] - conductivity*(outer_skin_temp-inner_skin_temp)/thickness - black_body_emissions(1,outer_emissivity,sigma, outer_skin_temp)
        if i >= len(interpolated_heatfluxes):
            outer_skin_heatflux = - conductivity * (outer_skin_temp - inner_skin_temp) / thickness - black_body_emissions(1, outer_emissivity,sigma, outer_skin_temp)

        internal_heatdump[i] = black_body_emissions(1, 5 ,sigma , inner_skin_temp)
        #internal_heatdump[i] = -internal_heating #conductivity*(outer_skin_temp-inner_skin_temp)/thickness + internal_heating
        inner_skin_heatflux = conductivity*(outer_skin_temp-inner_skin_temp)/thickness - internal_heatdump[i]
        outer_skin_temp = outer_skin_temp + outer_skin_heatflux/(outer_specific_heat*outer_weight)
        inner_skin_temp = inner_skin_temp + inner_skin_heatflux/(inner_specific_heat*inner_weight)

        #print("")
        #print("Time:",i)
        #print("Internal heating:", internal_heatdump[i])
        #print("Fluxes:",outer_skin_heatflux,inner_skin_heatflux)
        #print("Temps:",outer_skin_temp,inner_skin_temp)

        timelist[i] = i
        outer_skin_templist[i] = outer_skin_temp
        inner_skin_templist[i] = inner_skin_temp

    temperature_increase = sum(internal_heatdump)*surface_area/(dry_mass*specific_heat_alum)

    return timelist, outer_skin_templist,inner_skin_templist, temperature_increase


